-- CREATES TABLES
CREATE TABLE IF NOT EXISTS `accion_trabajos` (
  `accion` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `idobj` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `id` varchar(50) COLLATE utf8_bin DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `adminmail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `idtrabajo` int(100) NOT NULL,
  `idcliente` varchar(300) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `url` varchar(2000) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `idtrabajo` (`idtrabajo`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `alertas_fechas` (
  `id` bigint(20) NOT NULL,
  `fecha` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `numalerta` int(11) NOT NULL DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `alertas_trabajos` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `idtrabajo` int(100) NOT NULL,
  `tipo` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `verifsumin` int(11) NOT NULL DEFAULT '0',
  `sumincompleto` int(11) NOT NULL DEFAULT '0',
  `llamarprovs` int(11) NOT NULL DEFAULT '0',
  `suminentregados` int(11) NOT NULL DEFAULT '0',
  `correoclientes` int(11) NOT NULL DEFAULT '0',
  `verifpropuesta` int(11) NOT NULL DEFAULT '0',
  `correoproveedores` int(11) NOT NULL DEFAULT '0',
  `proptrabajoprovs` int(11) NOT NULL DEFAULT '0',
  `enviopropcliente` int(11) NOT NULL DEFAULT '0',
  `status` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `idtrabajo` (`idtrabajo`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `app_desayuno` (
  `id` int(11) NOT NULL,
  `id_proveedor` int(11) NOT NULL,
  `id_service` int(11) NOT NULL,
  `hora1` time DEFAULT NULL,
  `hora2` time DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `app_notifications` (
  `id` int(11) NOT NULL,
  `tipo` int(11) DEFAULT NULL,
  `id_service` int(11) DEFAULT NULL,
  `id_proveedor` int(11) DEFAULT NULL,
  `latitud` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `longitud` varchar(50) COLLATE utf8_bin DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `app_sucursales` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `idservicio` int(100) NOT NULL,
  `proveedor` int(100) NOT NULL,
  `idsucursal` int(11) NOT NULL DEFAULT '0',
  `txtsucursal` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `idservicio` (`idservicio`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `app_token` (
  `id` int(11) NOT NULL,
  `id_proveedor` int(11) NOT NULL,
  `token_fcm` varchar(500) COLLATE utf8_bin NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `app_tokenimg` (
  `id` bigint(20) NOT NULL,
  `imgtoken` varchar(300) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `imgstring` varchar(300) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `bloques` (
  `idbloque` int(11) NOT NULL AUTO_INCREMENT,
  `idcliente` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `nombre` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `encargado` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `ctacorreo` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `celular` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `teloficina` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `whatsapp` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `pass` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  PRIMARY KEY (`idbloque`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `clientes` (
  `idcliente` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `encargado` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `rfc` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `calle` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `noext` varchar(5) COLLATE utf8_bin DEFAULT '0',
  `noint` varchar(5) COLLATE utf8_bin DEFAULT '0',
  `colonia` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `cp` varchar(5) COLLATE utf8_bin DEFAULT '0',
  `pais` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `estado` int(11) DEFAULT NULL,
  `ciudad` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `municipio` int(11) DEFAULT NULL,
  `tel1` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `tel2` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `ctacorreo` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `sitioweb` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `pass` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  PRIMARY KEY (`idcliente`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `config_trabajo` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `idtrabajo` int(100) NOT NULL,
  `sucursal` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `cliente` varchar(300) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `cantidad` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `cantTienda` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `vigencia` varchar(300) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `tipo` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `idtrabajo` (`idtrabajo`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `config_trabajo_detalle` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `idconfig` int(100) NOT NULL,
  `sucursal` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `poligono` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `cantidad` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `estado` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `municipio` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idconfig` (`idconfig`)
) ENGINE=MyISAM AUTO_INCREMENT=65 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `config_trabajo_detalle_perifoneo` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `idconfig` int(100) NOT NULL,
  `inicio` datetime NOT NULL,
  `fin` datetime NOT NULL,
  `status` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `idconfig` (`idconfig`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `config_trabajo_perifoneo` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `idtrabajo` int(100) NOT NULL,
  `idsucursal` int(100) NOT NULL,
  `fecha` date NOT NULL,
  `inicio` datetime NOT NULL,
  `fin` datetime NOT NULL,
  `minutos` int(100) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `idtrabajo` (`idtrabajo`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `config_trabajo_proveedor` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `idsucursal` int(100) NOT NULL,
  `idtrabajo` int(100) NOT NULL,
  `cantidad` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `idproveedor` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `inicio` date DEFAULT '1111-11-11',
  `fin` date DEFAULT '1111-11-11',
  `status` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `idsucursal` (`idsucursal`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `detalles_trabajo` (
  `fk_idtrabajo` int(11) NOT NULL,
  `fk_idproveedor` int(11) NOT NULL,
  `edo_zona` varchar(50) COLLATE utf8_bin NOT NULL,
  `idedo` int(11) NOT NULL,
  `municipios` text COLLATE utf8_bin NOT NULL,
  `status` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `detalles_zona` (
  `idzona` int(11) NOT NULL,
  `edo` int(11) NOT NULL,
  `mun` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `fotos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_service` int(11) NOT NULL,
  `id_proveedor` int(11) NOT NULL,
  `id_sucursal` int(11) NOT NULL,
  `url` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `date_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`,`id_service`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `geolocation` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_device` varchar(50) COLLATE utf8_bin NOT NULL,
  `id_service` int(11) NOT NULL,
  `id_sucursal` int(11) NOT NULL,
  `id_proveedor` int(11) NOT NULL,
  `latitud` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `longitud` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `date_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`,`id_device`,`id_service`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `historial` (
  `id` int(11) NOT NULL,
  `usuario` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `fecha` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `hora` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `accion` varchar(500) COLLATE utf8_bin DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `poligono_seccion` (
  `id` bigint(20) NOT NULL,
  `zona` int(100) NOT NULL,
  `coords` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `nombre` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT 'NO ASIGNADO',
  `observaciones` text COLLATE utf8_bin,
  `numvolantes` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `hrsperifoneo` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `atributos` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `fecha_registro` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `status` int(20) NOT NULL DEFAULT '1'
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `poligono_zonas` (
  `id` bigint(20) NOT NULL,
  `territorio` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `coords` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `nombre` int(255) NOT NULL,
  `observaciones` text COLLATE utf8_bin,
  `numvolantes` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `hrsperifoneo` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `atributos` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `fecha_registro` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `status` int(20) NOT NULL DEFAULT '1'
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `proveedores` (
  `idproveedor` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `rfc` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `calle` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `noext` varchar(5) COLLATE utf8_bin DEFAULT '0',
  `noint` varchar(5) COLLATE utf8_bin DEFAULT '0',
  `colonia` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `cp` varchar(5) COLLATE utf8_bin DEFAULT '0',
  `pais` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `estado` int(11) DEFAULT NULL,
  `ciudad` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `municipio` int(11) DEFAULT NULL,
  `tel1` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `tel3` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `tel2` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `ctacorreo` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `banco` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `clavebanco` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `nosucursal` varchar(10) COLLATE utf8_bin DEFAULT NULL,
  `nocuenta` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `tarjeta` varchar(16) COLLATE utf8_bin DEFAULT NULL,
  `nombre_f` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `rfc_f` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `calle_f` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `noext_f` varchar(5) COLLATE utf8_bin DEFAULT NULL,
  `noint_f` varchar(5) COLLATE utf8_bin DEFAULT NULL,
  `colonia_f` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `cp_f` varchar(5) COLLATE utf8_bin DEFAULT NULL,
  `pais_f` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `estado_f` int(11) DEFAULT NULL,
  `ciudad_f` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `municipio_f` int(11) DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `pass` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`idproveedor`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `sucursales` (
  `idsucursal` int(11) NOT NULL AUTO_INCREMENT,
  `idbloque` int(100) DEFAULT NULL,
  `nombre` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `encargado` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `ctacorreo` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `telefono` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `estado` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `municipio` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `pass` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  PRIMARY KEY (`idsucursal`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `sucursales_domgeo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idsucursal` int(100) DEFAULT NULL,
  `estado` int(100) DEFAULT NULL,
  `municipio` int(100) DEFAULT NULL,
  `localidad` int(100) DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `sucursales_poligonos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idsucursal` int(100) DEFAULT NULL,
  `estado` int(100) DEFAULT NULL,
  `municipio` int(100) DEFAULT NULL,
  `idpoligono` int(100) DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `temp` (
  `edo` int(1) DEFAULT NULL,
  `mun` int(1) DEFAULT NULL,
  `cantidad` varchar(50) COLLATE utf8_bin DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `tiendas` (
  `idtienda` int(11) NOT NULL,
  `idcliente` int(11) DEFAULT NULL,
  `nombre` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `encargado` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `estado` int(11) DEFAULT NULL,
  `municipio` int(11) DEFAULT NULL,
  `localidad` int(11) DEFAULT NULL,
  `colonia` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `calle` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `cp` varchar(5) COLLATE utf8_bin DEFAULT NULL,
  `noext` varchar(5) COLLATE utf8_bin DEFAULT NULL,
  `noint` varchar(5) COLLATE utf8_bin DEFAULT NULL,
  `lat` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `lng` varchar(50) COLLATE utf8_bin DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `trabajos` (
  `idtrabajo` int(11) NOT NULL AUTO_INCREMENT,
  `idcliente` int(11) DEFAULT NULL,
  `fechasolicitud` date DEFAULT NULL,
  `hora` time DEFAULT NULL,
  `alias` varchar(80) COLLATE utf8_bin DEFAULT NULL,
  `recibido_via` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `tipo` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `cantidad` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `periodoini` date DEFAULT NULL,
  `periodofin` date DEFAULT NULL,
  `vigencia` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `detalles` varchar(500) COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  PRIMARY KEY (`idtrabajo`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `trabajos_nivel2` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fk_idTrabajo` int(11) NOT NULL,
  `idEdo` int(11) DEFAULT NULL,
  `edo` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `cantidad` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`,`fk_idTrabajo`),
  KEY `FK_trabajos_nivel2_trabajos` (`fk_idTrabajo`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `trabajos_sucursales` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idtrabajo` int(100) DEFAULT NULL,
  `idcliente` int(100) DEFAULT NULL,
  `idbloque` int(100) DEFAULT NULL,
  `idsucursal` int(100) DEFAULT NULL,
  `cantidad` int(100) DEFAULT NULL,
  `proveedores` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `trabajos_zonas_detalles` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idZonaTrabajo` int(11) NOT NULL,
  `idProveedor` int(11) NOT NULL,
  `cantidad` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `municipios` varchar(500) COLLATE utf8_bin DEFAULT NULL,
  `nocubiertos` varchar(500) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`,`idZonaTrabajo`,`idProveedor`),
  KEY `FK_trabajos_zonas_detalles_trabajos_zonas` (`idZonaTrabajo`),
  KEY `FK_trabajos_zonas_detalles_proveedores` (`idProveedor`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `usuarios` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `password` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  `ctacorreo` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `rol` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;


CREATE TABLE IF NOT EXISTS `zonas` (
  `idzona` int(11) NOT NULL AUTO_INCREMENT,
  `idProveedor` int(11) DEFAULT '0',
  `idEdo` int(11) DEFAULT NULL,
  `estado` text COLLATE utf8_bin,
  `costoservicio` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `costosadicionales` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`idzona`),
  KEY `proveedor` (`idProveedor`),
  KEY `estado` (`idEdo`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `zonaspoligonos` (
  `id` int(11) NOT NULL,
  `territorio` varchar(255) COLLATE utf8_bin NOT NULL,
  `nombre` varchar(255) COLLATE utf8_bin NOT NULL,
  `status` int(11) NOT NULL DEFAULT '1',
  `fecha_registro` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `estados` (
  `idestado` int(11) NOT NULL,
  `estado` varchar(45) COLLATE utf8_spanish_ci DEFAULT NULL,
  PRIMARY KEY (`idestado`),
